import React, { useState } from 'react';

const Card = ({}) => {

    const styles = {
        display: 'inline-block',
        width: '50%',
        height: '100px',
        border: '1px solid red'
    }

    return(
       <div style={styles}>
            <span></span>
       </div>
    );

}

export default Card;
